def word_frequency(s):
    if not s:
        return ''
    words = ''.join((e for e in s if e.isalnum() or e.isspace())).lower().split()
    word_count = {}
    for word in words:
        if word in word_count:
            word_count[word] += 1
        else:
            word_count[word] = 1
    sorted_word_count = sorted(word_count.items(), key=lambda x: x[1], reverse=True)
    return sorted_word_count

